import React,  { Component } from 'react';
import Layout from '../components/Layout';

export default class extends Component {
    render () {
        return (
            <Layout>
        <div className="container">
            <div className="title">Hey, got plants tonight?</div>
        <style jsx>
            {`

                .title {
                    color: white;
                    font-family: 'Ubuntu', sans-serif;
                    font-weight: bold;
                    letter-spacing: 0.1em;
                    font-size: 7em;
                };
            `}
        </style>
        <style jsx global>
            {`
                .body {
                    height: 100%;
                    width: 100%;
                };
                .container {
                    width: 100%;
                    height: 100%;
                    background-image: url("../assets/got-plants-tonight-desktop.jpg");
                    background-size: cover;
                    background-color: #7caf2c;
                }
            `}
        </style>
        </div>
        </Layout>
        )
    }
}
